ock.date##\n##ENDIFuser.account.lock.date##\n\n##password.update.link## ##user.password.update.url##','&lt;p&gt;&lt;strong&gt;##user.realname## ##user.firstname##&lt;/strong&gt;&lt;/p&gt;\n\n##IFuser.password.has_expired=1##\n&lt;p&gt;##lang.password.has_expired.information##&lt;/p&gt;\n##ENDIFuser.password.has_expired##\n##ELSEuser.password.has_expired##\n&lt;p&gt;##lang.password.expires_soon.information##&lt;/p&gt;\n##ENDELSEuser.password.has_expired##\n&lt;p&gt;##lang.user.password.expiration.date##: ##user.password.expiration.date##&lt;/p&gt;\n##IFuser.account.lock.date##\n&lt;p&gt;##lang.user.account.lock.date##: ##user.account.lock.date##&lt;/p&gt;\n##ENDIFuser.account.lock.date##\n\n&lt;p&gt;##lang.password.update.link## &lt;a href=\"##user.password.update.url##\"&gt;##user.password.update.url##&lt;/a&gt;&lt;/p&gt;'),(28,28,'','##lang.plugins_updates_available##','##lang.plugins_updates_available##\n\n##FOREACHplugins##\n##plugin.name## :##plugin.old_version## -&gt; ##plugin.version##\n##ENDFOREACHplugins##\n\n##lang.marketplace.url## : ##marketplace.url##','&lt;p&gt;##lang.plugins_updates_available##&lt;/p&gt;\n&lt;ul&gt;##FOREACHplugins##\n&lt;li&gt;##plugin.name## :##plugin.old_version## -&gt; ##plugin.version##&lt;/li&gt;\n##ENDFOREACHplugins##&lt;/ul&gt;\n&lt;p&gt;##lang.marketplace.url## : &lt;a title=\"##lang.marketplace.url##\" href=\"##marketplace.url##\" target=\"_blank\" rel=\"noopener\"&gt;##marketplace.url##&lt;/a&gt;&lt;/p&gt;'),(29,29,'','Your request has been saved','Hi,\\nYour request from GLPI has been successfully saved with number ##formcreator.request_id## and transmitted to the helpdesk team.\\nYou can see your answers onto the following link:\\n##formcreator.validation_link##','<p>Hi,<br />Your request from GLPI has been successfully saved with number ##formcreator.request_id## and transmitted to the helpdesk team.<br />You can see your answers onto the following link:<br />##formcreator.validation_link##</p>'),(30,30,'','A form from GLPI need to be validate','Hi,\\nA form from GLPI need to be validate and you have been choosen as the validator.\\nYou can access it by clicking onto this link:\\n##formcreator.validation_link##','<p>Hi,<br />A form from GLPI need to be validate and you have been choosen as the validator.<br />You can access it by clicking onto this link:<br />##formcreator.validation_link##</p>'),(31,31,'','Your form has been refused by the validator','Hi,\\nWe are sorry to inform you that your form has been refused by the validator for the reason below:\\n##formcreator.validation_comment##\\n\\nYou can still modify and resubmit it by clicking onto this link:\\n##formcreator.validation_link##','<p>Hi,<br />We are sorry to inform you that your form has been refused by the validator for the reason below:<br />##formcreator.validation_comment##<br /><br />You can still modify and resubmit it by clicking onto this link:<br />##formcreator.validation_link##</p>'),(32,32,'','Your form has been accepted by the validator','Hi,\\nWe are pleased to inform you that your form has been accepted by the validator.\\nYour request will be considered soon.','<p>Hi,<br />We are pleased to inform you that your form has been accepted by the validator.<br />Your request will be considered soon.</p>'),(33,33,'','Your form has been deleted by an administrator','Hi,\\nWe are sorry to inform you that your request cannot be considered and has been deleted by an administrator.','<p>Hi,<br />We are sorry to inform you that your request cannot be considered and has been deleted by an administrator.</p>');
